import GlobalStyle from "./Styles/GlobalStyled";
import AppRouter from "./Routes";
import Header  from "./Components/Header";
import { ThemeProvider } from "styled-components";


function App() {
  return (
    <ThemeProvider>
    <GlobalStyle/>
    <Header/>
    <AppRouter/>
    </ThemeProvider>
  );
}

export default App;
